window.bookSummaryJSON = "<p>Reagan Stuart is happy being alone. It’s hard to be disappointed if there aren’t any attachments.<br> <br> Hart Anderson knows that love hurts. He learned it as a kid, he learned it again as a teenager, and he learned it from his time in the military.<br> <br> Two broken souls, Reagan and Hart are on the same wavelength when it comes to relationships. It’s best to keep what they’ve got between them strictly physical.<br> <br> But things change. When Hart heads to Reagan’s for a night of fun, she’s gone.<br> <br> Vanished.<br> <br> Hart knows that Reagan would never just disappear, and he fears she’s in real trouble. It’s a race against the clock to get her back. And Hart can’t screw this up.<br> <br> Because even if he told himself she meant nothing to him, he knows it’s a lie. He’s in love, and Reagan’s the one who showed him how good it could be.</p>"; 
